  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer contains tree canopy data
  for Hawaii, in an Albers Equal-Area Conic projection and at a resolution of 100
  meters. The tree canopy data were derived from the National Land Cover Database
  (NLCD) 2001 percent tree canopy data set, a product of the Multi-Resolution Land
  Characteristics Consortium (MRLC). The MRLC is a multi-agency cooperative effort
  to study land cover change. The NLCD 2001 is described at <http://www.mrlc.gov/nlcd2001.php>.\",\n\t\"license_title\":
